import React from "react";

const Navigation = () => {
    return (
        <nav className="mnu">
            <DashboardItem />
            <TaskItem />
            <EmailItem />
            <ContactItem />
            <ChatItem />
            <DealsItem />
        </nav>
    );
}

export default Navigation;
